    const hideButton = () => {
        setIsShowButton(false);
    };

    const showButton = () => {
        setIsShowButton(true);
    };

    return (
        <>
            <h1>Welcome to our event planner app!</h1>
            <h3>Please login to continue</h3>
            <LoginForm />
            <br/><br/><br/><br/><br/><br/>
            <h3>Don't have an account yet?</h3>
            <Button component={Link} to="/register">
                {'Sign up for free'}
            </Button>
        </>
    );
};

export default Login;
